import { Component } from '@angular/core';
import { AuthService } from '../service/auth.service';
import { Route, Router } from '@angular/router';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {
[x: string]: any;

constructor(public authService: AuthService,private route:Router) {}

logout() {
  this.authService.logout();
  this.route.navigateByUrl("");
}
}
 <mat-toolbar class="header"  >
  <span class="logo">TheFoodExpress</span>
  <span class="spacer"></span>

 <button class="registration-btn" mat-button  id="home" routerLink="/" >Home</button>
  <button class="registration-btn" mat-button  routerLink="/registration">Register</button>

  <button class="login-btn" mat-button *ngIf="authService.isAuthenticatedUser(); else loginLink">

    <a (click)="logout()">Logout</a>
  </button>
  <ng-template #loginLink>
    <button class="login-btn" mat-button routerLink="/login">Login</button>
  </ng-template>


</mat-toolbar>




 <mat-toolbar class="header">
  <span class="logo">TheFoodExpress</span>
  <span class="spacer"></span>

  <button class="registration-btn" mat-button id="home" routerLink="/">Home</button>
  <button class="registration-btn" mat-button routerLink="/registration">Register</button>

  <ng-container *ngIf="authService.isAuthenticatedUser(); else loginLink">
    <!-- Display user email and logout dropdown if user is authenticated -->
    <div class="login-btn" mat-button [matMenuTriggerFor]="menu">
      {{ authService.getUserEmailPrefix() }}
    </div>
    <mat-menu #menu="matMenu">
      <button mat-menu-item (click)="logout()">Logout</button>
    </mat-menu>
  </ng-container>

  <ng-template #loginLink>
    <button class="login-btn" mat-button routerLink="/login">Login</button>
  </ng-template>
</mat-toolbar>
